import React, { useState } from "react";

const SignUpForm = () => {
  const [isFocused, setIsFocused] = useState(false);
  
  const styles = {
    background: {
      backgroundImage: "url('LBG.png')",  // Replace with your image URL
      backgroundSize: "cover",
      backgroundPosition: "center",
      backgroundAttachment: "fixed",
      height: "100%",
      width: "100%",
    },
    formWrapper: {
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      height: "100vh",
    },
    formContainer: {
      background: "rgba(255, 255, 255, 0.7)",
      backdropFilter: "blur(0px)",
      WebkitBackdropFilter: "blur(0px)",
      borderRadius: "10px",
      padding: "25px",
      boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
      width: "500px",
    },
    inputWrapper: {
      position: "relative",
      marginBottom: "20px",
    },
    input: {
      width: "100%",
      padding: "10px",
      paddingTop: "20px", // Space for the placeholder
      margin: "10px 0",
      border: "1px solid #ccc",
      borderRadius: "10px",
      fontSize: "16px",
      outline: "none",
    },
    placeholder: {
      position: "absolute",
      top: isFocused || document.querySelector('input[type="text"]').value ? "-10px" : "10px",
      left: "10px",
      color: isFocused ? "#C1B857" : "#aaa",
      fontSize: isFocused || document.querySelector('input[type="text"]').value ? "12px" : "16px", // Shrinks font size when focused or has value
      transition: "all 0.3s ease",
    },
    button: {
      width: "100%",
      padding: "10px",
      margin: "10px 0",
      border: "1px solid #ccc",
      borderRadius: "10px",
      backgroundColor: "#C1B857",
      color: "#363100",
      cursor: "pointer",
      fontWeight: "700",
    },
    socialButtonsContainer: {
      display: "flex",
      justifyContent: "center",
      gap: "30px", // Space between the buttons
      marginTop: "20px",
    },
    socialButtonImg: {
      width: "100%",
      maxWidth: "45px", // Ensure images do not stretch too much
      height: "auto",
      borderRadius: "10px",
      cursor: "pointer",
    },
    hr: {
      border: "none",
      borderTop: "1px solid #ccc",
      margin: "20px 0",
    },
    orText: {
      textAlign: "center",
      color: "#C1B857",
      fontSize: "14px",
      fontWeight: "400",
    },
  };

  const handleFocus = () => setIsFocused(true);
  const handleBlur = () => setIsFocused(false);

  return (
    <div style={styles.background}>
      <div style={styles.formWrapper}>
        <div style={styles.formContainer}>
          <form>
            <h2 style={{ textAlign: "center", fontSize: "70px", color: "#363100", fontWeight: "800" }}>
              <span>
                <img src="cuisining-wordmark.png" alt="C" style={{ height: "60px", width: "60px", marginBottom: "10px" }} />
              </span>
              UISINING
            </h2>
            {/* Name Input */}
            <div style={styles.inputWrapper}>
              <input
                type="text"
                placeholder="Full Name"
                required
                style={styles.input}
                onFocus={handleFocus}
                onBlur={handleBlur}
              />
              <div style={styles.placeholder}>Full Name</div>
            </div>
            {/* Username Input */}
            <div style={styles.inputWrapper}>
              <input
                type="text"
                placeholder="Username"
                required
                style={styles.input}
                onFocus={handleFocus}
                onBlur={handleBlur}
              />
              <div style={styles.placeholder}>Username</div>
            </div>
            {/* Password Input */}
            <div style={styles.inputWrapper}>
              <input
                type="password"
                placeholder="Password"
                required
                style={styles.input}
                onFocus={handleFocus}
                onBlur={handleBlur}
              />
              <div style={styles.placeholder}>Password</div>
            </div>
            {/* Confirm Password Input */}
            <div style={styles.inputWrapper}>
              <input
                type="password"
                placeholder="Confirm Password"
                required
                style={styles.input}
                onFocus={handleFocus}
                onBlur={handleBlur}
              />
              <div style={styles.placeholder}>Confirm Password</div>
            </div>
            {/* Sign Up Button */}
            <button type="submit" style={styles.button}>Sign Up</button>

            {/* Or Section */}
            <div style={styles.orText}>OR</div>
            <hr style={styles.hr} />
            
            {/* Social Media Buttons */}
            <div style={styles.socialButtonsContainer}>
              <a href="#" className="social-button" style={styles.socialButtonImg}>
                <img src="cuisining-wordmark.png" alt="Facebook Login" style={styles.socialButtonImg} />
              </a>
              <a href="#" className="social-button" style={styles.socialButtonImg}>
                <img src="cuisining-wordmark.png" alt="Google Login" style={styles.socialButtonImg} />
              </a>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default SignUpForm;
